
public class HandlingArrays {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
 
		String a[]=new String [4];
		a[0]="selenium";
		a[1]="jmeter";
		a[2]="iot";
		a[3]="appium";
		
		
		for(int i=0;i<a.length;i++)
		{
			System.out.println(a[i]);
		}
		
	}

}
